public XXHash32Test(final String path, final String c) throws IOException {
    final URL url = XXHash32Test.class.getClassLoader().getResource(path);
    if (url == null) {
        throw new FileNotFoundException("couldn't find " + path);
    }
    URI uri = null;
    try {
        uri = url.toURI();
    } catch (final java.net.URISyntaxException ex) {
        throw new IOException(ex);
    }
    file = new File(uri);
    expectedChecksum = c;
}

private static long copy(
        final InputStream input, final OutputStream output, final int buffersize)
        throws IOException {
    final byte[] buffer = new byte[buffersize];
    int n = 0;
    long count = 0;
    while (-1 != (n = input.read(buffer))) {
        output.write(buffer, 0, n);
        count += n;
    }
    return count;
}

